    number: '6'
    value: 'The Republican Party of Florida is now a Monthly Filer since they are
      participating in Federal Election Activity. The negative disbursement from National
      Union Fire Insurance Co. of $20,425.44 on 9/6/11 represents an insurance reimbursement
      for expenditures made and reported on 6/30/11 to Sukhia Law Group. The expense
      was reported as debt as of 12/31/10 and paid using the 21% federal/79% nonfederal
      split, so this insurance reimbursement is reported the same way. All expenditures
      to individuals for security services represent income to those individual and
      are not required to be itemized. No expenditure, other than a direct contribution
      or exempt activity so identified, was made on behalf of a specifically identified
      federal candidate. No expenditure not identified as such was for a public communication
      that referred to a clearly identified candidate for Federal office and that
      promoted, supported, attacked or opposed any such candidate for Federal office.
      All expenditures to individuals for rent represent rent income to those individuals
      and are not required to be itemized. All disbursements for salaries and benefits
      disclosed on Schedule H4 are for employees who did not spend more than 25% of
      their compensated time during the reporting period on Fed election activities
      or activities in connection with a Federal election. All transfers for allocated
      activity reported on Sch H3 occurred within the 70-day permitted window of time.
      The Committee uses the Escrow option for receipt of corporate in-kind donations
      as provided for by the Commission in Advisory Opinion 1992-33. The method ensures
      that prohibited sources are not used to fund the federal share of allocable
      activity expenses. In-kind details and the escrow account activity are summarized
      as follows:   COMBINED ESCROW BALANCE OF $3,186.58 as of 7/1/11.  Admin escrow
      account activity:  9/20/11 Transfer to Admin escrow acct of $3,000.  9/24/11
      Universal Orlando Resort in-kind of $15,000 as reflected on Sch H4 and transfer
      on Sch H3 using $5,400 of escrow balance.  Fundraising MD-12 escrow account
      activity:  8/25/11 Walt Disney Parks & Resorts in-kind of $768.84 as reflected
      on Sch H4 and transfer on Sch H3 using $115.33 of escrow balance.  8/29/11 BlueCross
      BlueShield of Florida in-kind of $8,882.66 as reflected on Sch H4 and transfer
      on Sch H3 using $1,332.40 of escrow balance.  10/28/11 Transfer to Fundraising
      MD-12 escrow acct of $54,000.00  COMBINED ESCROW BALANCE OF $53,338.86 as of
      10/31/11.  '
